import React from "react";
import "../node_modules/bootstrap/dist/js/bootstrap.bundle";
import Home from "./Home";
import {Switch, Route, Redirect } from "react-router-dom";
const App = () => {
    return (
        <>
        <Switch>
            <Route exact path="/" component={Home} />
        </Switch>
        </>
    );
};

export default App;
